import React from 'react';
import './Header.css';

function Header() {
  return (
      <header className="header">
    <div class="left-section">
      <div class="logo">
        chef <span class="logo-highlight">IT</span>
      </div>
      <nav class="nav-links">
        <button class="btn nav-item">Recipes</button>
        <button class="btn nav-item">Add Recipe</button>
      </nav>
    </div>

    <div class="auth-buttons">
      <button class="btn btn-login">Login</button>
      <button class="btn btn-login">Login</button>

    </div>
    </header>
  );
}

export default Header;
